import './App.css';
import {useState, useEffect} from "react";

function App() {

    const [people, setPeople] = useState([]);

    function getPeople() {
        const fetchData = async () => {
            try {
                const response = await fetch('http://localhost:8080/fetchData');
                const jsonData = await response.json();
                setPeople(jsonData);
            } catch (error) {
                console.error('error fetching', error);
            }
        }
    }

    useEffect(() => {
        getPeople();
    }, []);

    return (
    <div className="App">
        <p>Input Postman Collection ID</p>
        <div>
          <input/>
          <button>Test</button>
        </div>
          <div>
              <p className="current-results">Current Validation Results</p>
              <p className="previous-results">Previous Validation Results</p>
          </div>
    </div>
  );
}

export default App;
